import React, { Component } from 'react'
import { getUserCountry} from './logic'
export default class classCop extends Component {
    state = {
        user:{}
    }
    componentDidMount() {
        const y = getUserCountry()
        this.setState({...this.state,user:y})
    }
    render() {
        return (
            <div>
                {this.state.user[0].country_name}
            </div>
        )
    }
}
